import ComponentF from './ComponentF'
import { UserContext,ChannelContext } from '../../App'

function ComponentE() {

   const user =useContext(UserContext);
   const channel =useContext(ChannelContext); 
   return(
    <div>
        {user} and {channel}
    </div>
   )
}

export default ComponentE
